      <li><img src="./images/pic13.png" alt=""  className="image"/></li>
      <li><a>Home</a></li>
      <li><a>About Us</a></li>
      <li><a>Course</a></li>
      <li><a>Contact Us</a></li>
      <li><button>Join Class</button></li>
      <li><button>Book A Free Trial</button></li>
      </ul>
 
    </div>
    </>
  );
}
